webpackJsonp([0xc76c2e504617],{1437:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/squiddler/index.md absPath of file >>> MarkdownRemark",html:'<p>Squiddler has done some really cool stuff on the Flash platform, most of his blog posts are worth reading but check out these ones specifically:</p>\n<p><strong>Bumblebee:</strong> <a href="http://www.squidder.com/2008/11/14/bumblebee-the-easiest-path-from-excel-to-xml/">http://www.squidder.com/2008/11/14/bumblebee-the-easiest-path-from-excel-to-xml/</a> This AIR application is pretty cool - it allows you to take excel files and transform them into xml files by providing a simple template. Could be useful in those instances where we get the client to fill out a spreadsheet of information.</p>\n<p><strong>Real-time face recognition:</strong> <a href="http://www.squidder.com/2009/02/26/realtime-face-detection-in-flash/">http://www.squidder.com/2009/02/26/realtime-face-detection-in-flash/</a></p>\n<p><strong>AR drum kit:</strong> <a href="http://www.squidder.com/2009/03/03/augmented-reality-drum-kit/">http://www.squidder.com/2009/03/03/augmented-reality-drum-kit/</a></p>\n<p><strong>Other posts at:</strong> <a href="http://www.squidder.com/">http://www.squidder.com/</a></p>',frontmatter:{title:"Squiddler",date:"March 16, 2009",tags:["air-applications","augmented-reality","excel"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/setting-up-asdoc-in-flex-builder/",tags:["actionscript","flex","asdoc"],title:"Setting up ASDoc in Flex Builder",date:"2009-03-16T09:46:55.000Z",description:null,image:null}},next:{frontmatter:{path:"/blog/imagesizer-reviewed-on-refreshingappscom/",tags:["imagesizer"],title:"ImageSizer reviewed on RefreshingApps.com",date:"2009-03-20T19:34:41.000Z",description:null,image:null}}}}}});
